import './App.css';
import pokemons from './data';



function App() {

  const Pokemon = () => {
    pokemons.map((poke) => {
      console.log(poke);
      return (
        <article className="Pokemon" key={poke.id}>
          <h1>{poke.name}</h1>
          <img src={poke.image} alt='valor'></img>
        </article>
      )
    })
  }

  return (
    <main>
      <h1>Pokedex</h1>
        <Pokemon />
    </main>

  );
}

export default App;
